# Helper to run a BigQuery SQL string and return a data frame
download_data <- function(sql) {
  tb <- bq_project_query(Sys.getenv("GOOGLE_PROJECT"), sql)
  bq_table_download(tb)
}

# 0) Your OMOP dataset
DATASET <- Sys.getenv("WORKSPACE_CDR")

# 1) Drug classes & their ingredient substrings (from eTable 2)
drug_lists <- list(
  SU           = c("glimepiride", "glipizide", "glyburide"),
  DPP4         = c("alogliptin", "linagliptin", "sitagliptin", "saxagliptin"),
