                   "guanethidine","tolazoline","sodium nitroprusside",
                   "phenoxybenzamine","phentolamine","fenoldopam")
)

# 2) Build CTE clauses for each drug class
cte_clauses <- map2_chr(names(drug_lists), drug_lists, ~{
  like_sql <- paste0("LOWER(c.concept_name) LIKE '%", .y, "%'", collapse = " OR ")
  glue("
  {.x} AS (
    SELECT ca.descendant_concept_id AS concept_id
    FROM `{DATASET}.concept` c
    JOIN `{DATASET}.concept_ancestor` ca
      ON c.concept_id = ca.ancestor_concept_id
    WHERE c.concept_class_id = 'Ingredient'
      AND ({like_sql})
  )")
})
cte_drugs <- paste(cte_clauses, collapse = ",\n")

# 3) Build the single UNION ALL block for filtering exposures
union_parts <- paste0("SELECT concept_id FROM ", names(drug_lists))
union_sql   <- paste(union_parts, collapse = " UNION ALL ")

# 4) Compose the full SQL with every CTE, each separated by commas
sql_all <- glue("
WITH
{cte_drugs},
Exposures AS (
  SELECT
    de.person_id,
    CASE
      {paste0('WHEN de.drug_concept_id IN (SELECT concept_id FROM ', names(drug_lists),
              ') THEN \"', names(drug_lists), '\"', collapse = '\n      ')}
    END AS drug_class,
    de.drug_exposure_start_date AS exposure_date
  FROM `{DATASET}.drug_exposure` de
  WHERE de.drug_exposure_start_date BETWEEN '2014-01-01' AND '2021-12-31'
    AND de.drug_concept_id IN (
      {union_sql}
    )
),
FirstExp AS (
  SELECT
    person_id,
    drug_class,
    exposure_date,
    ROW_NUMBER() OVER (PARTITION BY person_id, drug_class ORDER BY exposure_date) AS rn
  FROM Exposures
),
Cohorts AS (
  SELECT person_id, drug_class, exposure_date AS index_date
  FROM FirstExp
  WHERE rn = 1
),
PriorOther AS (
  SELECT e.person_id, c.drug_class
  FROM Exposures e
  JOIN Cohorts c
    ON e.person_id = c.person_id
   AND e.drug_class <> c.drug_class
   AND e.exposure_date < c.index_date
)
SELECT
  c.person_id,
  c.drug_class,
  c.index_date
FROM Cohorts c
LEFT JOIN PriorOther p
  ON c.person_id = p.person_id
 AND c.drug_class = p.drug_class
WHERE p.person_id IS NULL
")

# 5) Run the query once and download
all_cohorts <- download_data(sql_all)

# 6) Split into one data frame per drug_class
cohort_list <- all_cohorts %>%
  group_split(drug_class) %>%
  set_names(map_chr(., ~ unique(.x$drug_class)))

# 7) Quick check: number of patients per cohort
cohort_list %>% map_int(nrow)

# First, create a master list of all unique person_ids across all cohorts
all_persons <- unique(all_cohorts$person_id)

# For each drug class, add a binary indicator column (1 if in that cohort, 0 if not)
for (drug_class_name in names(cohort_list)) {
  # Get the person_ids in this cohort
  persons_in_cohort <- cohort_list[[drug_class_name]]$person_id
  
  # Create a new column with 1 for patients in this cohort, 0 otherwise
  merged_df[[drug_class_name]] <- as.integer(merged_df$person_id %in% persons_in_cohort)
}

# Check the first few rows of the resulting dataframe
head(merged_df)

# 1) Define the substrings for all the common insulin ingredients
drug_insulin <- c(
  "insulin glargine", "insulin aspart", "insulin lispro",
  "insulin detemir", "insulin degludec", "insulin glulisine",
  "insulin regular", "insulin isophane", "insulin human", "insulin"
)

# 2) Build the LIKEâ€OR clause for the CTE
like_sql_insulin <- paste0(
  "LOWER(c.concept_name) LIKE '%", 
  drug_insulin, 
  "%'", 
  collapse = " OR "
)

# 3) Assemble the full SQL
sql_insulin <- glue::glue("
WITH
  Insulin AS (
    SELECT
      ca.descendant_concept_id AS concept_id
    FROM `{DATASET}.concept` c
    JOIN `{DATASET}.concept_ancestor` ca
      ON c.concept_id = ca.ancestor_concept_id
    WHERE
      c.concept_class_id = 'Ingredient'
      AND ({like_sql_insulin})
  ),
  Exposures AS (
    SELECT
      de.person_id,
      de.drug_exposure_start_date AS exposure_date
    FROM `{DATASET}.drug_exposure` de
    WHERE
      de.drug_concept_id IN (SELECT concept_id FROM Insulin)
      AND de.drug_exposure_start_date BETWEEN '2014-01-01' AND '2021-12-31'
  ),
  FirstInsulin AS (
    SELECT
      person_id,
      MIN(exposure_date) AS index_date
    FROM Exposures
    GROUP BY person_id
  )
SELECT
  person_id,
  index_date
FROM FirstInsulin
")

# 4) Run and fetch the insulin cohort
insulin_cohort <- download_data(sql_insulin)

# 5) Quick check
insulin_cohort %>% 
  summarise(
    n_patients = n_distinct(person_id),
    earliest = min(index_date),
    latest   = max(index_date)
  )

summary(insulin_cohort)

merged_df <- merged_df %>%
  mutate(
    Insulin = as.integer(person_id %in% insulin_cohort$person_id)
  )
