condition_codes_hiv_icd10 <- c('B20')

get_cohort <- function(condition_codes_icd9, condition_codes_icd10) {
  condition_codes_icd9_string <- toString(sprintf("'%s'", condition_codes_icd9))
  condition_codes_icd10_string <- toString(sprintf("'%s'", condition_codes_icd10))

  condition_sql <- str_glue("
    SELECT 
        c.concept_name,
        c.concept_code,
        c.concept_id
    FROM 
        `{DATASET}.concept` c
        JOIN `{DATASET}.condition_occurrence` co
            ON c.concept_id = co.condition_source_concept_id
    WHERE
        (vocabulary_id='ICD9CM' AND concept_code IN (%s))
        OR (vocabulary_id='ICD10CM' AND concept_code IN (%s))
    GROUP BY
        c.concept_name,
        c.concept_code,
        c.concept_id
  ")

  query <- sprintf(condition_sql, condition_codes_icd9_string, condition_codes_icd10_string)
  condition_concepts_df <- download_data(query)

  condition_concepts_string <- paste(condition_concepts_df$concept_id, collapse = ", ")

  cohort_sql <- str_glue("
    SELECT *
    FROM `{DATASET}.person`
    WHERE
        person_id IN (SELECT person_id
                      FROM `{DATASET}.condition_occurrence`
                      WHERE condition_source_concept_id IN (%s))
  ")

  query <- sprintf(cohort_sql, condition_concepts_string)
  cohort <- download_data(query)
  
  return(cohort)
}

